کوتاهی قد در کودکان و اسیب‌های جدی تربا مصرف نوشابه‌های انرژی زا
مصرف نوشابه‌های انرژی زا تهدیدی جدی برای سلامت کودکان و نوجوانان محسوب میشود . مصرف   نوشابه‌های انرژی زا   موجب اختلال هضم و کاهش جذب عناصر مغذی مانند کلسیم ، منیزیم ، روی و اهن در روده میشود ، جذب کلسیم در روده مصرف کنندگان این نوشابه ، یک پنجم افراد دیگر است . علاوه بر این ، نوشابه‌های انرژی دار با توجه به گازدار بودن حاوی مقادیر معینی از گاز دی اکسید کربن و مواد اسیدی کننده چون اسید فسفریک و نگه دارنده هایی چون سولفات پتاسیم هستند . با توجه به اسیدی شدن محیط خون در مصرف کنندگان و جبران این محیط توسط برداشت کلسیم از استخوان‌ها ، کوتاهی قد از عوارض شایع این نوع نوشید نی‌ها می‌باشد .
