طرز تهیه :
شکر و اب و هل و زنجبیل رو میذاریم روی حرارت تا شکر حل بشه . شکر که حل شد گلاب زعفران غلیظ دمکرده رو‌اضافه کرده و‌اژ روی حرارت برمیداریم تا از داغی بیفته . شهد خیلی نباید غل بخوره .
ارد رو روی حرارت ملایم تفت میدیم ده دقیقه بعد ادویه رو اضافه کرده و یه ربع دیگه تفت میدیم .
حالا روغن جامد رو اضافه کرده ولی روغن مایع رو کم کم اضافه میکنیم تا روغن اضافه به خرد ارد نره . باید نهایتا بافتش نرم بشه .
ده دقیقه یه ربع دیگه تفت میدیم تا روغن خوب جذب ارد بشه .
زیر گاز رو‌خاموش‌میکنیم و 👇🏻
حالا شهد رو‌کم‌کم‌اضافه کرده و تند تند هم میزنیم تا ارد گلوله نشه اگر شد میتونین از همزن برقی هم استفاده کنین . وقتی تمام شهد رو ریختیم زیر گاز رو‌روشن میکنیم و‌اینقدر هم‌میزنیم تا کاچی جا بیفته و به غلظت برسه .
